import numpy as np
from numpy import pi
from wilson.run.smeft.beta import my_einsum


Nc = 3
# Eq. (3.42)
CA = Nc
CF = (Nc**2-1)/(2*Nc)
C1 = (Nc**2-1)/(4*Nc**2)
Cd = (Nc**2-4)/Nc


qu = 2/3
qd = -1/3
qe = -1

nu = 2
nd = 3
ne = 3

b0g = (11*Nc - 2*(nd + nu))/3.
b0e = (-4*(Nc*nd*qd**2 + ne*qe**2 + Nc*nu*qu**2))/3.


def beta(C, n_gen=3):
    e = C["e"]
    g = C["gs"]

    # set undefined Wilson coefficients to zero
    zeros_4F = np.zeros((n_gen,n_gen,n_gen,n_gen))
    zeros_2F = np.zeros((n_gen,n_gen))
    C['SnunuLL'] = zeros_4F
    C['SnueLL'] = zeros_4F
    C['SnueLR'] = zeros_4F
    C['SnuuLL'] = zeros_4F
    C['SnuuLR'] = zeros_4F
    C['SnudLL'] = zeros_4F
    C['SnudLR'] = zeros_4F
    C['nugamma'] = zeros_2F

    # define Kronecker delta
    C['delta'] = np.eye(n_gen)

    # Eq. (3.41)
    zetae = (8/3)*(2*my_einsum("wv,wv",C["nugamma"],C["nugamma"].conj())+my_einsum("wv,wv",C["egamma"],C["egamma"].conj())+Nc*my_einsum("wv,wv",C["ugamma"],C["ugamma"].conj())+Nc*my_einsum("wv,wv",C["dgamma"],C["dgamma"].conj()))
    zetag = (4/3)*(my_einsum("wv,wv",C["uG"],C["uG"].conj())+my_einsum("wv,wv",C["dG"],C["dG"].conj()))


    Beta = {}

    # Dimension 3: Masses

    Beta["Mnu"] =   zeros_2F#24*my_einsum("vwrs,wv",C["SnunuLL"],C["Mnu"].conj().T @ C["Mnu"] @ C["Mnu"].conj().T)  +  16*my_einsum("wrvs,wv",C["VnunuLL"],C["Mnu"] @ C["Mnu"].conj().T @ C["Mnu"])  +  8*my_einsum("rsvw,wv",C["SnueLL"],C["Me"].conj().T @ C["Me"] @ C["Me"].conj().T)  +  8*my_einsum("rsvw,wv",C["SnueLR"],C["Me"] @ C["Me"].conj().T @ C["Me"])  +  8*Nc*my_einsum("rsvw,wv",C["SnuuLL"],C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  +  8*Nc*my_einsum("rsvw,wv",C["SnuuLR"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  +  8*Nc*my_einsum("rsvw,wv",C["SnudLL"],C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  +  8*Nc*my_einsum("rsvw,wv",C["SnudLR"],C["Md"] @ C["Md"].conj().T @ C["Md"])  -  48*my_einsum("rw,uv,wv,us",C["nugamma"],C["nugamma"].conj(),C["Mnu"].conj().T @ C["Mnu"],C["Mnu"])  +  16*my_einsum("rw,vw,vs",C["nugamma"],C["nugamma"].conj(),C["Mnu"] @ C["Mnu"].conj().T @ C["Mnu"])  -  48*my_einsum("wu,vs,wv,ru",C["nugamma"].conj(),C["nugamma"],C["Mnu"] @ C["Mnu"].conj().T,C["Mnu"])  +  16*my_einsum("wv,ws,rv",C["nugamma"].conj(),C["nugamma"],C["Mnu"] @ C["Mnu"].conj().T @ C["Mnu"])  -  96*my_einsum("rv,ws,vw",C["nugamma"],C["nugamma"],C["Mnu"].conj().T @ C["Mnu"] @ C["Mnu"].conj().T)

    Beta["Me"] =  -  6*qe**2*e**2*my_einsum("rs",C["Me"])  #+  12*qe*e*my_einsum("vr,vs",C["egamma"].conj(),C["Me"].conj().T @ C["Me"])  +  12*qe*e*my_einsum("sv,rv",C["egamma"].conj(),C["Me"] @ C["Me"].conj().T)  +  4*my_einsum("vwrs,wv",C["SnueLL"],C["Mnu"].conj().T @ C["Mnu"] @ C["Mnu"].conj().T)  +  4*my_einsum("wvsr,wv",C["SnueLR"].conj(),C["Mnu"] @ C["Mnu"].conj().T @ C["Mnu"])  +  (8*my_einsum("srwv,wv",C["SeeRR"].conj(),C["Me"].conj().T @ C["Me"] @ C["Me"].conj().T)  -  4*my_einsum("wrsv,wv",C["SeeRR"].conj(),C["Me"].conj().T @ C["Me"] @ C["Me"].conj().T))  -  8*my_einsum("vsrw,wv",C["VeeLR"],C["Me"] @ C["Me"].conj().T @ C["Me"])  +  4*Nc*my_einsum("srwv,wv",C["SeuRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  +  4*Nc*my_einsum("srwv,wv",C["SeuRL"].conj(),C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  +  4*Nc*my_einsum("srwv,wv",C["SedRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  +  4*Nc*my_einsum("srwv,wv",C["SedRL"].conj(),C["Md"] @ C["Md"].conj().T @ C["Md"])  -  12*my_einsum("wr,vu,wv,us",C["egamma"].conj(),C["egamma"],C["Me"].conj().T @ C["Me"],C["Me"])  +  4*my_einsum("wr,wv,vs",C["egamma"].conj(),C["egamma"],C["Me"] @ C["Me"].conj().T @ C["Me"])  -  12*my_einsum("uw,sv,wv,ru",C["egamma"],C["egamma"].conj(),C["Me"] @ C["Me"].conj().T,C["Me"])  +  4*my_einsum("vw,sw,rv",C["egamma"],C["egamma"].conj(),C["Me"] @ C["Me"].conj().T @ C["Me"])  -  24*my_einsum("vr,sw,vw",C["egamma"].conj(),C["egamma"].conj(),C["Me"].conj().T @ C["Me"] @ C["Me"].conj().T)

    Beta["Mu"] =  -  6*(CF*g**2  +  qu**2*e**2)*my_einsum("rs",C["Mu"])  #+  12*(CF*g*my_einsum("vr,vs",C["uG"].conj(),C["Mu"].conj().T @ C["Mu"])  +  qu*e*my_einsum("vr,vs",C["ugamma"].conj(),C["Mu"].conj().T @ C["Mu"]))  +  12*(CF*g*my_einsum("sv,rv",C["uG"].conj(),C["Mu"] @ C["Mu"].conj().T)  +  qu*e*my_einsum("sv,rv",C["ugamma"].conj(),C["Mu"] @ C["Mu"].conj().T))  +  4*my_einsum("vwrs,wv",C["SnuuLL"],C["Mnu"].conj().T @ C["Mnu"] @ C["Mnu"].conj().T)  +  4*my_einsum("wvsr,wv",C["SnuuLR"].conj(),C["Mnu"] @ C["Mnu"].conj().T @ C["Mnu"])  +  4*my_einsum("wvsr,wv",C["SeuRR"].conj(),C["Me"].conj().T @ C["Me"] @ C["Me"].conj().T)  +  4*my_einsum("vwrs,wv",C["SeuRL"],C["Me"] @ C["Me"].conj().T @ C["Me"])  +  (8*Nc*my_einsum("srwv,wv",C["S1uuRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  -  4*my_einsum("svwr,wv",C["S1uuRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  -  4*CF*my_einsum("svwr,wv",C["S8uuRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T))  -  8*(my_einsum("vsrw,wv",C["V1uuLR"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  +  CF*my_einsum("vsrw,wv",C["V8uuLR"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"]))  +  (4*Nc*my_einsum("srwv,wv",C["S1udRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  -  2*my_einsum("svwr,wv",C["S1udduRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  -  2*CF*my_einsum("svwr,wv",C["S8udduRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T))  -  8*(my_einsum("svwr,wv",C["V1udduLR"].conj(),C["Md"] @ C["Md"].conj().T @ C["Md"])  +  CF*my_einsum("svwr,wv",C["V8udduLR"].conj(),C["Md"] @ C["Md"].conj().T @ C["Md"]))  -  12*my_einsum("wr,vu,wv,us",C["ugamma"].conj(),C["ugamma"],C["Mu"].conj().T @ C["Mu"],C["Mu"])  +  4*my_einsum("wr,wv,vs",C["ugamma"].conj(),C["ugamma"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  -  12*my_einsum("uw,sv,wv,ru",C["ugamma"],C["ugamma"].conj(),C["Mu"] @ C["Mu"].conj().T,C["Mu"])  +  4*my_einsum("vw,sw,rv",C["ugamma"],C["ugamma"].conj(),C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  -  12*CF*my_einsum("wr,vu,wv,us",C["uG"].conj(),C["uG"],C["Mu"].conj().T @ C["Mu"],C["Mu"])  +  4*CF*my_einsum("wr,wv,vs",C["uG"].conj(),C["uG"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  -  12*CF*my_einsum("uw,sv,wv,ru",C["uG"],C["uG"].conj(),C["Mu"] @ C["Mu"].conj().T,C["Mu"])  +  4*CF*my_einsum("vw,sw,rv",C["uG"],C["uG"].conj(),C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  -  24*my_einsum("vr,sw,vw",C["ugamma"].conj(),C["ugamma"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  -  24*CF*my_einsum("vr,sw,vw",C["uG"].conj(),C["uG"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)

    Beta["Md"] =  -  6*(CF*g**2  +  qd**2*e**2)*my_einsum("rs",C["Md"])  #+  12*(CF*g*my_einsum("vr,vs",C["dG"].conj(),C["Md"].conj().T @ C["Md"])  +  qd*e*my_einsum("vr,vs",C["dgamma"].conj(),C["Md"].conj().T @ C["Md"]))  +  12*(CF*g*my_einsum("sv,rv",C["dG"].conj(),C["Md"] @ C["Md"].conj().T)  +  qd*e*my_einsum("sv,rv",C["dgamma"].conj(),C["Md"] @ C["Md"].conj().T))  +  4*my_einsum("vwrs,wv",C["SnudLL"],C["Mnu"].conj().T @ C["Mnu"] @ C["Mnu"].conj().T)  +  4*my_einsum("wvsr,wv",C["SnudLR"].conj(),C["Mnu"] @ C["Mnu"].conj().T @ C["Mnu"])  +  4*my_einsum("wvsr,wv",C["SedRR"].conj(),C["Me"].conj().T @ C["Me"] @ C["Me"].conj().T)  +  4*my_einsum("vwrs,wv",C["SedRL"],C["Me"] @ C["Me"].conj().T @ C["Me"])  +  (4*Nc*my_einsum("wvsr,wv",C["S1udRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  -  2*my_einsum("wrsv,wv",C["S1udduRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T)  -  2*CF*my_einsum("wrsv,wv",C["S8udduRR"].conj(),C["Mu"].conj().T @ C["Mu"] @ C["Mu"].conj().T))  -  8*(my_einsum("vsrw,wv",C["V1udduLR"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"])  +  CF*my_einsum("vsrw,wv",C["V8udduLR"],C["Mu"] @ C["Mu"].conj().T @ C["Mu"]))  +  (8*Nc*my_einsum("wvsr,wv",C["S1ddRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  -  4*my_einsum("wrsv,wv",C["S1ddRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  -  4*CF*my_einsum("wrsv,wv",C["S8ddRR"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T))  -  8*(my_einsum("vsrw,wv",C["V1ddLR"],C["Md"] @ C["Md"].conj().T @ C["Md"])  +  CF*my_einsum("vsrw,wv",C["V8ddLR"],C["Md"] @ C["Md"].conj().T @ C["Md"]))  -  12*my_einsum("wr,vu,wv,us",C["dgamma"].conj(),C["dgamma"],C["Md"].conj().T @ C["Md"],C["Md"])  +  4*my_einsum("wr,wv,vs",C["dgamma"].conj(),C["dgamma"],C["Md"] @ C["Md"].conj().T @ C["Md"])  -  12*my_einsum("uw,sv,wv,ru",C["dgamma"],C["dgamma"].conj(),C["Md"] @ C["Md"].conj().T,C["Md"])  +  4*my_einsum("vw,sw,rv",C["dgamma"],C["dgamma"].conj(),C["Md"] @ C["Md"].conj().T @ C["Md"])  -  12*CF*my_einsum("wr,vu,wv,us",C["dG"].conj(),C["dG"],C["Md"].conj().T @ C["Md"],C["Md"])  +  4*CF*my_einsum("wr,wv,vs",C["dG"].conj(),C["dG"],C["Md"] @ C["Md"].conj().T @ C["Md"])  -  12*CF*my_einsum("uw,sv,wv,ru",C["dG"],C["dG"].conj(),C["Md"] @ C["Md"].conj().T,C["Md"])  +  4*CF*my_einsum("vw,sw,rv",C["dG"],C["dG"].conj(),C["Md"] @ C["Md"].conj().T @ C["Md"])  -  24*my_einsum("vr,sw,vw",C["dgamma"].conj(),C["dgamma"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)  -  24*CF*my_einsum("vr,sw,vw",C["dG"].conj(),C["dG"].conj(),C["Md"].conj().T @ C["Md"] @ C["Md"].conj().T)

    # Dimension 4: Gauge Couplings

    Beta["e"] =  -  b0e*e**3  -  8*e**2*qe*(my_einsum("rs,sr",C["egamma"],C["Me"])  +  my_einsum("rs,rs",C["Me"].conj().T,C["egamma"].conj()))  -  8*e**2*Nc*qu*(my_einsum("rs,sr",C["ugamma"],C["Mu"])  +  my_einsum("rs,rs",C["Mu"].conj().T,C["ugamma"].conj()))  -  8*e**2*Nc*qd*(my_einsum("rs,sr",C["dgamma"],C["Md"])  +  my_einsum("rs,rs",C["Md"].conj().T,C["dgamma"].conj()))  +  8*e*(2*my_einsum("ts,sr,rp,pt",C["Mnu"].conj().T,C["nugamma"],C["Mnu"].conj().T,C["nugamma"])  +  2*my_einsum("pr,sr,st,pt",C["Mnu"],C["nugamma"].conj(),C["Mnu"],C["nugamma"].conj())  +  my_einsum("ts,sr,rp,pt",C["Me"],C["egamma"],C["Me"],C["egamma"])  +  my_einsum("pr,sr,st,pt",C["Me"].conj().T,C["egamma"].conj(),C["Me"].conj().T,C["egamma"].conj())  +  Nc*my_einsum("ts,sr,rp,pt",C["Mu"],C["ugamma"],C["Mu"],C["ugamma"])  +  Nc*my_einsum("pr,sr,st,pt",C["Mu"].conj().T,C["ugamma"].conj(),C["Mu"].conj().T,C["ugamma"].conj())  +  Nc*my_einsum("ts,sr,rp,pt",C["Md"],C["dgamma"],C["Md"],C["dgamma"])  +  Nc*my_einsum("pr,sr,st,pt",C["Md"].conj().T,C["dgamma"].conj(),C["Md"].conj().T,C["dgamma"].conj()))

    Beta["gs"] =  -  b0g*g**3  -  4*g**2*(my_einsum("rs,sr",C["uG"],C["Mu"])  +  my_einsum("rs,rs",C["Mu"].conj().T,C["uG"].conj()))  -  4*g**2*(my_einsum("rs,sr",C["dG"],C["Md"])  +  my_einsum("rs,rs",C["Md"].conj().T,C["dG"].conj()))  +  4*g*(my_einsum("ts,sr,rp,pt",C["Mu"],C["uG"],C["Mu"],C["uG"])  +  my_einsum("pr,sr,st,pt",C["Mu"].conj().T,C["uG"].conj(),C["Mu"].conj().T,C["uG"].conj())  +  my_einsum("ts,sr,rp,pt",C["Md"],C["dG"],C["Md"],C["dG"])  +  my_einsum("pr,sr,st,pt",C["Md"].conj().T,C["dG"].conj(),C["Md"].conj().T,C["dG"].conj()))

    #Beta["thetaQCD"] =   ((64*pi**2)/(g))*(1j*my_einsum("rs,sr",C["uG"],C["Mu"])  -  1j*my_einsum("rs,rs",C["Mu"].conj().T,C["uG"].conj()))  +  ((64*pi**2)/(g))*(1j*my_einsum("rs,sr",C["dG"],C["Md"])  -  1j*my_einsum("rs,rs",C["Md"].conj().T,C["dG"].conj()))  +  ((32*pi**2)/(g**2))*2j*(  -  my_einsum("ts,sr,rp,pt",C["Mu"],C["uG"],C["Mu"],C["uG"])  +  my_einsum("ts,sr,rp,pt",C["Mu"].conj(),C["uG"].conj(),C["Mu"].conj(),C["uG"].conj())  -  my_einsum("ts,sr,rp,pt",C["Md"],C["dG"],C["Md"],C["dG"])  +  my_einsum("ts,sr,rp,pt",C["Md"].conj(),C["dG"].conj(),C["Md"].conj(),C["dG"].conj()))

    #Beta["thetaQED"] =   ((128*pi**2*qe)/(e))*(1j*my_einsum("rs,sr",C["egamma"],C["Me"])  -  1j*my_einsum("rs,rs",C["Me"].conj().T,C["egamma"].conj()))  +  ((128*Nc*pi**2*qu)/(e))*(1j*my_einsum("rs,sr",C["ugamma"],C["Mu"])  -  1j*my_einsum("rs,rs",C["Mu"].conj().T,C["ugamma"].conj()))  +  ((128*Nc*pi**2*qd)/(e))*(1j*my_einsum("rs,sr",C["dgamma"],C["Md"])  -  1j*my_einsum("rs,rs",C["Md"].conj().T,C["dgamma"].conj()))  +  ((32*pi**2)/(e**2))*4j*(2*my_einsum("ts,sr,rp,pt",C["Mnu"].conj().T,C["nugamma"],C["Mnu"].conj().T,C["nugamma"])  -  2*my_einsum("pr,sr,st,pt",C["Mnu"],C["nugamma"].conj(),C["Mnu"],C["nugamma"].conj())  -  my_einsum("ts,sr,rp,pt",C["Me"],C["egamma"],C["Me"],C["egamma"])  +  my_einsum("pr,sr,st,pt",C["Me"].conj().T,C["egamma"].conj(),C["Me"].conj().T,C["egamma"].conj())  -  Nc*my_einsum("ts,sr,rp,pt",C["Mu"],C["ugamma"],C["Mu"],C["ugamma"])  +  Nc*my_einsum("pr,sr,st,pt",C["Mu"].conj().T,C["ugamma"].conj(),C["Mu"].conj().T,C["ugamma"].conj())  -  Nc*my_einsum("ts,sr,rp,pt",C["Md"],C["dgamma"],C["Md"],C["dgamma"])  +  Nc*my_einsum("pr,sr,st,pt",C["Md"].conj().T,C["dgamma"].conj(),C["Md"].conj().T,C["dgamma"].conj()))

    # Dimension 5: Dipole Operators

    Beta["nugamma"] =  -  b0e*e**2*my_einsum("rs",C["nugamma"])  -  8*e*qe*(my_einsum("rs,vw,wv",C["nugamma"],C["egamma"],C["Me"])  +  my_einsum("rs,vw,vw",C["nugamma"],C["Me"].conj().T,C["egamma"].conj()))  -  8*e*Nc*qu*(my_einsum("rs,vw,wv",C["nugamma"],C["ugamma"],C["Mu"])  +  my_einsum("rs,vw,vw",C["nugamma"],C["Mu"].conj().T,C["ugamma"].conj()))  -  8*e*Nc*qd*(my_einsum("rs,vw,wv",C["nugamma"],C["dgamma"],C["Md"])  +  my_einsum("rs,vw,vw",C["nugamma"],C["Md"].conj().T,C["dgamma"].conj()))

    Beta["egamma"] =   (10*qe**2  -  b0e)*e**2*my_einsum("rs",C["egamma"])  -  8*e*Nc*qd*my_einsum("wv,rsvw",C["Md"],C["TedRR"])  -  8*e*Nc*qu*my_einsum("wv,rsvw",C["Mu"],C["TeuRR"])  +  2*e*qe*my_einsum("wv,rwvs",C["Me"],C["SeeRR"])  -  12*e*qe*my_einsum("rw,wv,vs",C["egamma"],C["Me"],C["egamma"])  -  8*e*qe*(my_einsum("vw,rw,vs",C["egamma"].conj(),C["egamma"],C["Me"].conj().T)  +  my_einsum("vw,vs,rw",C["egamma"].conj(),C["egamma"],C["Me"].conj().T))  -  8*e*qe*(my_einsum("rs,vw,wv",C["egamma"],C["egamma"],C["Me"])  +  my_einsum("rs,vw,vw",C["egamma"],C["Me"].conj().T,C["egamma"].conj()))  -  8*e*Nc*qu*(my_einsum("rs,vw,wv",C["egamma"],C["ugamma"],C["Mu"])  +  my_einsum("rs,vw,vw",C["egamma"],C["Mu"].conj().T,C["ugamma"].conj()))  -  8*e*Nc*qd*(my_einsum("rs,vw,wv",C["egamma"],C["dgamma"],C["Md"])  +  my_einsum("rs,vw,vw",C["egamma"],C["Md"].conj().T,C["dgamma"].conj()))

    Beta["ugamma"] =   (2*CF*g**2  +  (10*qu**2  -  b0e)*e**2)*my_einsum("rs",C["ugamma"])  +  8*CF*e*g*qu*my_einsum("rs",C["uG"])  -  8*e*qe*my_einsum("wv,vwrs",C["Me"],C["TeuRR"])  +  2*e*qu*my_einsum("wv,rwvs",C["Mu"],C["S1uuRR"])  +  2*e*CF*qu*my_einsum("wv,rwvs",C["Mu"],C["S8uuRR"])  +  e*qd*my_einsum("wv,rwvs",C["Md"],C["S1udduRR"])  +  e*CF*qd*my_einsum("wv,rwvs",C["Md"],C["S8udduRR"])  -  (4*g*CF*my_einsum("rw,vw,vs",C["ugamma"],C["uG"].conj(),C["Mu"].conj().T)  +  8*e*qu*my_einsum("rw,vw,vs",C["ugamma"],C["ugamma"].conj(),C["Mu"].conj().T))  -  (4*g*CF*my_einsum("rw,vw,vs",C["Mu"].conj().T,C["uG"].conj(),C["ugamma"])  +  8*e*qu*my_einsum("rw,vw,vs",C["Mu"].conj().T,C["ugamma"].conj(),C["ugamma"]))  -  8*e*qe*(my_einsum("rs,vw,wv",C["ugamma"],C["egamma"],C["Me"])  +  my_einsum("rs,vw,vw",C["ugamma"],C["Me"].conj().T,C["egamma"].conj()))  -  8*e*Nc*qu*(my_einsum("rs,vw,wv",C["ugamma"],C["ugamma"],C["Mu"])  +  my_einsum("rs,vw,vw",C["ugamma"],C["Mu"].conj().T,C["ugamma"].conj()))  -  8*e*Nc*qd*(my_einsum("rs,vw,wv",C["ugamma"],C["dgamma"],C["Md"])  +  my_einsum("rs,vw,vw",C["ugamma"],C["Md"].conj().T,C["dgamma"].conj()))  -  12*e*qu*my_einsum("rw,wv,vs",C["ugamma"],C["Mu"],C["ugamma"])  -  4*e*qu*CF*my_einsum("wv,rw,vs",C["Mu"],C["uG"],C["uG"])  -  4*g*CF*(my_einsum("wv,rw,vs",C["Mu"],C["ugamma"],C["uG"])  +  my_einsum("wv,rw,vs",C["Mu"],C["uG"],C["ugamma"]))  -  4*CF*e*qu*my_einsum("wv,ws,rv",C["uG"].conj(),C["uG"],C["Mu"].conj().T)  -  4*CF*e*qu*my_einsum("rw,vw,vs",C["uG"],C["uG"].conj(),C["Mu"].conj().T)

    Beta["dgamma"] =   (2*CF*g**2  +  (10*qd**2  -  b0e)*e**2)*my_einsum("rs",C["dgamma"])  +  8*CF*e*g*qd*my_einsum("rs",C["dG"])  -  8*e*qe*my_einsum("wv,vwrs",C["Me"],C["TedRR"])  +  2*e*qd*my_einsum("wv,rwvs",C["Md"],C["S1ddRR"])  +  2*e*CF*qd*my_einsum("wv,rwvs",C["Md"],C["S8ddRR"])  +  e*qu*my_einsum("wv,vsrw",C["Mu"],C["S1udduRR"])  +  e*CF*qu*my_einsum("wv,vsrw",C["Mu"],C["S8udduRR"])  -  (4*g*CF*my_einsum("rw,vw,vs",C["dgamma"],C["dG"].conj(),C["Md"].conj().T)  +  8*e*qd*my_einsum("rw,vw,vs",C["dgamma"],C["dgamma"].conj(),C["Md"].conj().T))  -  (4*g*CF*my_einsum("rw,vw,vs",C["Md"].conj().T,C["dG"].conj(),C["dgamma"])  +  8*e*qd*my_einsum("rw,vw,vs",C["Md"].conj().T,C["dgamma"].conj(),C["dgamma"]))  -  8*e*qe*(my_einsum("rs,vw,wv",C["dgamma"],C["egamma"],C["Me"])  +  my_einsum("rs,vw,vw",C["dgamma"],C["Me"].conj().T,C["egamma"].conj()))  -  8*e*Nc*qu*(my_einsum("rs,vw,wv",C["dgamma"],C["ugamma"],C["Mu"])  +  my_einsum("rs,vw,vw",C["dgamma"],C["Mu"].conj().T,C["ugamma"].conj()))  -  8*e*Nc*qd*(my_einsum("rs,vw,wv",C["dgamma"],C["dgamma"],C["Md"])  +  my_einsum("rs,vw,vw",C["dgamma"],C["Md"].conj().T,C["dgamma"].conj()))  -  12*e*qd*my_einsum("rw,wv,vs",C["dgamma"],C["Md"],C["dgamma"])  -  4*e*qd*CF*my_einsum("wv,rw,vs",C["Md"],C["dG"],C["dG"])  -  4*g*CF*(my_einsum("wv,rw,vs",C["Md"],C["dgamma"],C["dG"])  +  my_einsum("wv,rw,vs",C["Md"],C["dG"],C["dgamma"]))  -  4*CF*e*qd*my_einsum("wv,ws,rv",C["dG"].conj(),C["dG"],C["Md"].conj().T)  -  4*CF*e*qd*my_einsum("rw,vw,vs",C["dG"],C["dG"].conj(),C["Md"].conj().T)

    Beta["uG"] =   ((10*CF  -  4*CA  -  b0g)*g**2  +  2*e**2*qu**2)*my_einsum("rs",C["uG"])  +  8*e*g*qu*my_einsum("rs",C["ugamma"])  +  3*g**2*CA*my_einsum("rs",C["Mu"].conj().T)*(C["G"]  +  1j*C["Gtilde"])  +  2*g*my_einsum("wv,rwvs",C["Mu"],C["S1uuRR"])  +  2*g*(CF  -  ((1)/(2))*CA)*my_einsum("wv,rwvs",C["Mu"],C["S8uuRR"])  +  g*my_einsum("wv,rwvs",C["Md"],C["S1udduRR"])  +  g*(CF  -  ((1)/(2))*CA)*my_einsum("wv,rwvs",C["Md"],C["S8udduRR"])  -  ((8*CF  -  2*CA)*g*my_einsum("rw,vw,vs",C["uG"],C["uG"].conj(),C["Mu"].conj().T)  +  4*e*qu*my_einsum("rw,vw,vs",C["uG"],C["ugamma"].conj(),C["Mu"].conj().T))  -  ((8*CF  -  2*CA)*g*my_einsum("rw,vw,vs",C["Mu"].conj().T,C["uG"].conj(),C["uG"])  +  4*e*qu*my_einsum("rw,vw,vs",C["Mu"].conj().T,C["ugamma"].conj(),C["uG"]))  -  4*g*(my_einsum("rs,vw,wv",C["uG"],C["uG"],C["Mu"])  +  my_einsum("rs,vw,vw",C["uG"],C["Mu"].conj().T,C["uG"].conj()))  -  4*g*(my_einsum("rs,vw,wv",C["uG"],C["dG"],C["Md"])  +  my_einsum("rs,vw,vw",C["uG"],C["Md"].conj().T,C["dG"].conj()))  +  (10*CA  -  12*CF)*g*my_einsum("rw,wv,vs",C["uG"],C["Mu"],C["uG"])  -  4*e*qu*(my_einsum("wv,rw,vs",C["Mu"],C["ugamma"],C["uG"])  +  my_einsum("wv,rw,vs",C["Mu"],C["uG"],C["ugamma"]))  -  4*g*my_einsum("wv,rw,vs",C["Mu"],C["ugamma"],C["ugamma"])  -  4*g*my_einsum("wv,ws,rv",C["ugamma"].conj(),C["ugamma"],C["Mu"].conj().T)  -  4*g*my_einsum("rw,vw,vs",C["ugamma"],C["ugamma"].conj(),C["Mu"].conj().T)

    Beta["dG"] =   ((10*CF  -  4*CA  -  b0g)*g**2  +  2*e**2*qd**2)*my_einsum("rs",C["dG"])  +  8*e*g*qd*my_einsum("rs",C["dgamma"])  +  3*g**2*CA*my_einsum("rs",C["Md"].conj().T)*(C["G"]  +  1j*C["Gtilde"])  +  2*g*my_einsum("wv,rwvs",C["Md"],C["S1ddRR"])  +  2*g*(CF  -  ((1)/(2))*CA)*my_einsum("wv,rwvs",C["Md"],C["S8ddRR"])  +  g*my_einsum("wv,vsrw",C["Mu"],C["S1udduRR"])  +  g*(CF  -  ((1)/(2))*CA)*my_einsum("wv,vsrw",C["Mu"],C["S8udduRR"])  -  ((8*CF  -  2*CA)*g*my_einsum("rw,vw,vs",C["dG"],C["dG"].conj(),C["Md"].conj().T)  +  4*e*qd*my_einsum("rw,vw,vs",C["dG"],C["dgamma"].conj(),C["Md"].conj().T))  -  ((8*CF  -  2*CA)*g*my_einsum("rw,vw,vs",C["Md"].conj().T,C["dG"].conj(),C["dG"])  +  4*e*qd*my_einsum("rw,vw,vs",C["Md"].conj().T,C["dgamma"].conj(),C["dG"]))  -  4*g*(my_einsum("rs,vw,wv",C["dG"],C["uG"],C["Mu"])  +  my_einsum("rs,vw,vw",C["dG"],C["Mu"].conj().T,C["uG"].conj()))  -  4*g*(my_einsum("rs,vw,wv",C["dG"],C["dG"],C["Md"])  +  my_einsum("rs,vw,vw",C["dG"],C["Md"].conj().T,C["dG"].conj()))  +  (10*CA  -  12*CF)*g*my_einsum("rw,wv,vs",C["dG"],C["Md"],C["dG"])  -  4*e*qd*(my_einsum("wv,rw,vs",C["Md"],C["dgamma"],C["dG"])  +  my_einsum("wv,rw,vs",C["Md"],C["dG"],C["dgamma"]))  -  4*g*my_einsum("wv,rw,vs",C["Md"],C["dgamma"],C["dgamma"])  -  4*g*my_einsum("wv,ws,rv",C["dgamma"].conj(),C["dgamma"],C["Md"].conj().T)  -  4*g*my_einsum("rw,vw,vs",C["dgamma"],C["dgamma"].conj(),C["Md"].conj().T)

    # X^3

    Beta["G"] =   (12*CA  -  3*b0g)*g**2*C["G"]

    Beta["Gtilde"]  =(12*CA  -  3*b0g)*g**2*C["Gtilde"]

    # \psi^4: (\overline L L)*(\overline L L)

    Beta["VnunuLL"] =   0

    Beta["VeeLL"] =   12*e**2*qe**2*my_einsum("prst",C["VeeLL"])  +  ((1)/(3))*e**2*qe*(Nc*qd*my_einsum("pr,stww",C["delta"],C["VedLL"])  +  Nc*qd*my_einsum("pr,stww",C["delta"],C["VedLR"])  +  Nc*qu*my_einsum("pr,stww",C["delta"],C["VeuLL"])  +  Nc*qu*my_einsum("pr,stww",C["delta"],C["VeuLR"])  +  qe*(4*my_einsum("pr,stww",C["delta"],C["VeeLL"])  +  my_einsum("pr,stww",C["delta"],C["VeeLR"])))  +  ((1)/(3))*e**2*qe*(Nc*qd*my_einsum("st,prww",C["delta"],C["VedLL"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VedLR"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VeuLL"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VeuLR"])  +  qe*(4*my_einsum("st,prww",C["delta"],C["VeeLL"])  +  my_einsum("st,prww",C["delta"],C["VeeLR"])))  +  ((1)/(3))*e**2*qe*(Nc*qd*my_einsum("pt,srww",C["delta"],C["VedLL"])  +  Nc*qd*my_einsum("pt,srww",C["delta"],C["VedLR"])  +  Nc*qu*my_einsum("pt,srww",C["delta"],C["VeuLL"])  +  Nc*qu*my_einsum("pt,srww",C["delta"],C["VeuLR"])  +  qe*(4*my_einsum("pt,srww",C["delta"],C["VeeLL"])  +  my_einsum("pt,srww",C["delta"],C["VeeLR"])))  +  ((1)/(3))*e**2*qe*(Nc*qd*my_einsum("sr,ptww",C["delta"],C["VedLL"])  +  Nc*qd*my_einsum("sr,ptww",C["delta"],C["VedLR"])  +  Nc*qu*my_einsum("sr,ptww",C["delta"],C["VeuLL"])  +  Nc*qu*my_einsum("sr,ptww",C["delta"],C["VeuLR"])  +  qe*(4*my_einsum("sr,ptww",C["delta"],C["VeeLL"])  +  my_einsum("sr,ptww",C["delta"],C["VeeLR"])))  +  ((26)/(3))*e**2*qe**2*(my_einsum("pw,rw,st",C["egamma"],C["egamma"].conj(),C["delta"])  +  my_einsum("sw,tw,pr",C["egamma"],C["egamma"].conj(),C["delta"])  +  my_einsum("pw,tw,sr",C["egamma"],C["egamma"].conj(),C["delta"])  +  my_einsum("sw,rw,pt",C["egamma"],C["egamma"].conj(),C["delta"]))  +  e**2*qe**2*zetae*my_einsum("pr,st",C["delta"],C["delta"])

    Beta["VnueLL"] =   ((4)/(3))*e**2*qe*(Nc*qu*my_einsum("st,prww",C["delta"],C["VnuuLL"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VnuuLR"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VnudLL"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VnudLR"])  +  qe*(my_einsum("st,prww",C["delta"],C["VnueLL"])  +  my_einsum("st,prww",C["delta"],C["VnueLR"])))  +  96*e**2*qe**2*my_einsum("wr,wp,st",C["nugamma"],C["nugamma"].conj(),C["delta"])

    Beta["VnuuLL"] =   ((4)/(3))*e**2*qu*(Nc*qu*my_einsum("st,prww",C["delta"],C["VnuuLL"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VnuuLR"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VnudLL"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VnudLR"])  +  qe*(my_einsum("st,prww",C["delta"],C["VnueLL"])  +  my_einsum("st,prww",C["delta"],C["VnueLR"])))  +  96*e**2*qu**2*my_einsum("wr,wp,st",C["nugamma"],C["nugamma"].conj(),C["delta"])

    Beta["VnudLL"] =   ((4)/(3))*e**2*qd*(Nc*qu*my_einsum("st,prww",C["delta"],C["VnuuLL"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VnuuLR"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VnudLL"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VnudLR"])  +  qe*(my_einsum("st,prww",C["delta"],C["VnueLL"])  +  my_einsum("st,prww",C["delta"],C["VnueLR"])))  +  96*e**2*qd**2*my_einsum("wr,wp,st",C["nugamma"],C["nugamma"].conj(),C["delta"])

    Beta["VeuLL"] =   ((4)/(3))*e**2*qe*(Nc*qd*my_einsum("pr,stww",C["delta"],C["V1udLL"])  +  Nc*qd*my_einsum("pr,stww",C["delta"],C["V1udLR"])  +  Nc*qu*(2*my_einsum("pr,stww",C["delta"],C["VuuLL"])  +  my_einsum("pr,stww",C["delta"],C["V1uuLR"]))  +  qe*my_einsum("pr,wwst",C["delta"],C["VeuLL"])  +  qe*my_einsum("pr,stww",C["delta"],C["VueLR"])  +  2*qu*my_einsum("pr,swwt",C["delta"],C["VuuLL"]))  +  ((4)/(3))*e**2*qu*(Nc*qd*my_einsum("st,prww",C["delta"],C["VedLL"])  +  Nc*qd*my_einsum("st,prww",C["delta"],C["VedLR"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VeuLL"])  +  Nc*qu*my_einsum("st,prww",C["delta"],C["VeuLR"])  +  qe*(4*my_einsum("st,prww",C["delta"],C["VeeLL"])  +  my_einsum("st,prww",C["delta"],C["VeeLR"])))  +  12*e**2*qe*qu*my_einsum("prst",C["VeuLL"])  -  ((16)/(3))*CF*e**2*qe*qu*my_einsum("sw,tw,pr",C["uG"],C["uG"].conj(),C["delta"])  +  8*CF*e*g*qe*(my_einsum("sw,tw,pr",C["uG"],C["ugamma"].conj(),C["delta"])  +  my_einsum("sw,tw,pr",C["ugamma"],C["uG"].conj(),C["delta"]))  +  e**2*(24*qu**2  +  ((32)/(3))*qe*qu)*my_einsum("pw,rw,st",C["egamma"],C["egamma"].conj(),C["delta"])  +  e**2*(24*qe**2  +  ((32)/(3))*qe*qu)*my_einsum("sw,tw,pr",C["ugamma"],C["ugamma"].conj(),C["delta"])  +  2*e**2*qe*qu*zetae*my_einsum("pr,st",C["delta"],C["delta"])

